var storage = chrome.storage.sync;
var psml = 1;
var bpl = 2;
var ppml = 3;
function createPSMLPlayersMap() {
    var playersMap = {};
    for (var j = 0; j < psmlPlayers.length; j++) {
        playersMap[psmlPlayers[j].playerId] = psmlPlayers[j].teamName;
    }
    return playersMap;
}

function createPPMLPlayersMap() {
    var playersMap = {};
    for (var j = 0; j < ppmlPlayers.length; j++) {
        playersMap[ppmlPlayers[j].playerId] = ppmlPlayers[j].teamName;
    }
    return playersMap;
}

function createBPLPlayersMap(){
    var playersMap = {};
    for (var j = 0; j < bplPlayers.length; j++){
        playersMap[bplPlayers[j].playerId] = bplPlayers[j].teamName;
    }
    return playersMap;
}

function findUsedPlayers(playersMap, leagueId) {
    var playersTable = document.getElementsByClassName('players');

    if (playersTable.length>0) {
        var playerRows = playersTable[0].getElementsByTagName("tr");

        for (var i = 1; i < playerRows.length; i++) {
            var playerColumns = playerRows[i].getElementsByTagName('td');
            var pesdbPUrl = playerColumns[1].getElementsByTagName('a')[0].getAttribute("href");
            var pesdbPId = pesdbPUrl.substring(pesdbPUrl.lastIndexOf('=') + 1);
            var valueMap = playersMap[pesdbPId];
            if (valueMap !== undefined) {
                var newTd = document.createElement("td");
                newTd.setAttribute("class", "left");
                if (leagueId === psml) {
                    newTd.setAttribute("style", "background-color: blue;");
                } else if (leagueId === bpl){
                    newTd.setAttribute("style", "background-color: green;");
                } else if (leagueId === ppml){
                    newTd.setAttribute("style", "background-color: red;");
                }
                newTd.innerHTML = valueMap;
                playerRows[i].appendChild(newTd);
            }else{
                var newTd = document.createElement("td");
                newTd.setAttribute("class", "left");
                newTd.setAttribute("style", "background-color: black;");
                playerRows[i].appendChild(newTd);
            }
        }
    }
};

(function () {
    let psmlState;
    storage.get("psmlState",function (fetchedData) {
        psmlState = fetchedData.psmlState;
        if (psmlState === 1){
            var playersPsmlMap = createPSMLPlayersMap();
            findUsedPlayers(playersPsmlMap, psml);
        }
    });
    let ppmlState;
    storage.get("ppmlState",function (fetchedData) {
        ppmlState = fetchedData.ppmlState;
        if (ppmlState === 1){
            var playersPpmlMap = createPPMLPlayersMap();
            findUsedPlayers(playersPpmlMap, ppml);
        }
    });
    let bplState;
    storage.get("bplState",function (fetchedData) {
        bplState = fetchedData.bplState;
        if (bplState === 1){
            var playersBPLMap = createBPLPlayersMap();
            findUsedPlayers(playersBPLMap, bpl);
        }
    });
})();

